/* modifica descripciones de 4 digitos */
UPDATE

	ciex_4,
	ciex_4_2013_modif
	
SET

	ciex_4.descripcion = ciex_4_2013_modif.descripcion_c4_2013
	
WHERE

	ciex_4.cod_3dig = ciex_4_2013_modif.cod_3dig
AND	ciex_4.cod_4dig = ciex_4_2013_modif.cod_4dig;


/* modifica descripciones de 3 digitos */
UPDATE

	ciex_3,
	ciex_3_2013_modif
	
SET

	ciex_3.descripcion = ciex_3_2013_modif.descripcion_c3_2013
	
WHERE

	ciex_3.cod_3dig = ciex_3_2013_modif.cod_3dig;
